template = ERB.new <<-EOF

<!DOCTYPE html>
<html>
<head>
  <title>Software Brewmasters Company Name Generator</title>
  <meta http-equiv="Content-type" content="text/html;charset=UTF-8">
  <link rel="stylesheet" type="text/css" href="namer.css" />
<script type="text/javascript">

  var _gaq = _gaq || [];
  _gaq.push(['_setAccount', 'UA-355803-1']);
  _gaq.push(['_trackPageview']);
  var page_tracker;

  (function() {
    var ga = document.createElement('script'); ga.type = 'text/javascript'; ga.async = true;
    ga.src = ('https:' == document.location.protocol ? 'https://ssl' : 'http://www') + '.google-analytics.com/ga.js';
    var s = document.getElementsByTagName('script')[0]; s.parentNode.insertBefore(ga, s);
    page_tracker = function () {
      page_tracker = _gat._getTracker('UA-355803-1');
    };
  })();

</script>
</head>
<body>
  <h1>Software Brewmasters Company Name Generator</h1>
  <p id="company_name">Loading word list...</p>
  <img id="generate_button" src="images/GenerateRegular.gif" alt="Generate"/>
  <br>
  <img id="back_button" src="images/BackRegular.gif" alt="Back"/>
  <img id="suffix_button" src="images/SuffixInitial.gif" alt="Change Suffix"/>

  <br>
  <p><a id="about" href="http://timbreitkreutz.blogspot.ca/2012/08/upmarket-akimichi-corp.html">About</a></p>

<script type="text/javascript">


// Code provided under creative commons attribution share-alike licence (CC BY-SA)
// 2015 Tim Breitkreutz

(function () {
    "use strict";

    var suffixes = ["", "Inc.", "Co.", "Corp.", "LLP", "LLC", "Group", "& Co."],

        words = <%= wordlist %>,
        syllables = <%= syllablelist %>,
        word_count = words.length,
        history = [],
        generate_count = 0,
        generate_total = 0,
        name_suffix = "",

        back = function () {
            if (generate_count > 1) {
                generate_count -= 1;
                document.getElementById("company_name").innerHTML = history[generate_count - 1];
            }
        },

        get_syllable = function () {
            return syllables[Math.floor(Math.random() * syllables.length)];
        },

        synthesize_word = function () {
            var word = get_syllable();
            if (word.length < 10 && Math.random() < 0.4) {
                word =  get_syllable() + word;
            }
            if (word.length < 10 && Math.random() < 0.2) {
                word = get_syllable() + word;
            }
            return word.charAt(0).toUpperCase() + word.slice(1);
        },

        get_word = function () {
            if (Math.random() < 0.8) {
                return words[Math.floor(Math.random() * word_count)];
            } else {
                return synthesize_word();
            }
        },

        generate = function () {
            var word;
            if (generate_count === generate_total) {
                word = get_word();
                if (Math.random() < 0.4 || word.length < 4) {
                    word =  get_word() + " " + word;
                }
                if (Math.random() < 0.2) {
                    word = get_word() + " " + word;
                }
                if (name_suffix.length > 0) {
                    word = word + " " + name_suffix;
                }
                history[generate_count] = word;
                generate_total += 1;
                generate_count += 1;
                page_tracker._trackPageview('example');
            } else {
                word = history[generate_count];
                generate_count += 1;
            }
            document.getElementById("company_name").innerHTML = word;
        },
 
        suffix = function () {
            var new_suffix = name_suffix;
            while (new_suffix === name_suffix) {
                new_suffix = suffixes[Math.floor(Math.random() * suffixes.length)];
            }
            name_suffix = new_suffix;
            generate_count = generate_total;
            generate();
            document.getElementById("suffix_button").innerHTML = "Change Suffix";
        },

        generate_mousedown = function () {
            document.getElementById("generate_button").src = "images/GenerateSelected.gif";
        },

        generate_mouseup = function () {
            document.getElementById("generate_button").src = "images/GenerateRegular.gif";
        },

        back_mousedown = function () {
            if (generate_count > 1) {
                document.getElementById("back_button").src = "images/BackSelected.gif";
            }
        },

        back_mouseup = function () {
            document.getElementById("back_button").src = "images/BackRegular.gif";
        },

        suffix_mousedown = function () {
            document.getElementById("suffix_button").src = "images/SuffixSelected.gif";
        },

        suffix_mouseup = function () {
            document.getElementById("suffix_button").src = "images/SuffixRegular.gif";
        };

    window.onload = function () {
        document.createElement("img").src = "images/SuffixRegular.gif";
        document.createElement("img").src = "images/SuffixSelected.gif";
        document.createElement("img").src = "images/BackSelected.gif";
        document.createElement("img").src = "images/GenerateSelected.gif";

        document.getElementById("suffix_button").onclick = suffix;
        document.getElementById("generate_button").onclick = generate;
        document.getElementById("back_button").onclick = back;

        document.getElementById("generate_button").onmousedown = generate_mousedown;
        document.getElementById("generate_button").onmouseup = generate_mouseup;

        document.getElementById("generate_button").ontouchstart = generate_mousedown;
        document.getElementById("generate_button").ontouchend = generate_mouseup;

        document.getElementById("back_button").onmousedown = back_mousedown;
        document.getElementById("back_button").onmouseup = back_mouseup;

        document.getElementById("back_button").ontouchstart = back_mousedown;
        document.getElementById("back_button").ontouchend = back_mouseup;

        document.getElementById("suffix_button").onmousedown = suffix_mousedown;
        document.getElementById("suffix_button").onmouseup = suffix_mouseup;

        document.getElementById("suffix_button").ontouchstart = suffix_mousedown;
        document.getElementById("suffix_button").ontouchend = suffix_mouseup;

        page_tracker();
        generate();
    };
}());
</script>
</body>
</html>
EOF

puts template.result(binding)
